import React, { Component } from 'react';

export class Test extends Component {
    static displayName = Test.name;

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <h1>This is a test</h1>
                <p>lodada dadadada</p>
                <p>lodada dadadada</p>
                <p>lodada dadadada</p>
                <p>lodada dadadada</p>
            </div>
        )
    }
}

